import React from 'react';
import {Button, ButtonGroup} from "react-bootstrap";

const Beat = ({beat}) => {
    const handleClick = (beat) => {
        localStorage.setItem('beat',(beat.id).toString())
        window.location.replace(`beat/${beat.id}`)

    }


    return (
        <>
                <td>
                            <span>
                                <img src="marv.png" alt=""/>
                            </span>
                    <span>
                               &nbsp; {beat.title}
                            </span>
                </td>
                <td>02:54</td>
                <td> 0 </td>
                <td>
                    <span className={"beat-labels modal-beat-label"}>HipHop</span>
                </td>
                <td>
                    <ButtonGroup>
                        <Button className={'mr-3'}>Add to Cart</Button>
                        <Button >Share</Button>
                    </ButtonGroup>
                </td>


            {/*<h1 onClick={(e) => handleClick(beat.id,e)}>{beat.title}</h1>*/}
        </>
    );
}

export default Beat;
